class Solution {
    func punishmentNumber(_ n: Int) -> Int {
        func check(_ i: Int) -> Bool {
            let square = i * i
            let str = String(square)
            for start in 0..<str.count {
                var sum = 0
                for end in start..<str.count {
                    let range = str.index(str.startIndex, offsetBy: start)...str.index(str.startIndex, offsetBy: end)
                    if let num = Int(str[range]) {
                        sum += num
                        if sum == i {
                            return true
                        }
                    }
                }
            }
            return false
        }

        var sum = 0
        for i in 1...n {
            if check(i) {
                sum += i * i
            }
        }
        return sum
    }
}
